elements.expression:
filters
| essql 
  query="SELECT address.country as country, count(*) as number FROM \"person*\" group by country"
| pointseries color="country" size="number"
| pie hole=72 legend=false labels=false palette={palette "#C5FAF4" "#0F6259" gradient=true}
| render containerStyle={containerStyle opacity="1"}

filters
| essql query="SELECT gender, count(*) as number FROM \"person*\" group by gender"
| pointseries color="gender" size="number"
| pie hole=72 legend=false seriesStyle={seriesStyle label="female" color="#ec77a8"}
  seriesStyle={seriesStyle label="male" color="#4cbce4"} labels=false
| render containerStyle={containerStyle opacity="1"}

filters
| essql 
  query="SELECT YEAR(dateofbirth) AS year, gender, count(*) as persons  FROM \"person\" GROUP BY year, gender"
| pointseries x="year" y="mean(persons)" color="gender"
| plot legend=false yaxis=false xaxis={axisConfig position="bottom"} 
  font={font family="'Open Sans', Helvetica, Arial, sans-serif" size=14 align="left" color="#BBBBBB" weight="normal" underline=false italic=false} palette={palette "#f7fcb9" "#addd8e" "#31a354" gradient=true} seriesStyle={seriesStyle label="female" lines="1" points="0" color="#e74b8b"}
  seriesStyle={seriesStyle label="male" lines="1" points="0" color="#1ea6dc"}
| render

markdown "# Elasticsearch
## You know for search!  
### " {date | formatdate "DD/MM/YYYY"} " " 
  font={font family="'Open Sans', Helvetica, Arial, sans-serif" size=14 align="left" color="#FFFFFF" weight="normal" underline=false italic=false}
| render 
  containerStyle={containerStyle backgroundColor="#3f9939" border="0px none " padding="12px" opacity="0.9"}

filters
| demodata
| markdown "# From 6.5" 
  font={font family="'Open Sans', Helvetica, Arial, sans-serif" size=14 align="center" color="#000000" weight="normal" underline=false italic=false}
| render containerStyle={containerStyle backgroundColor="#f8dd91" opacity="0.5"}

filters
| essql 
  query="SELECT name, gender, dateofbirth as \"date of birth\", children as \"number of children\", address.country as country, address.city as city FROM \"person\""
| markdown "{{#each columns}}
* **{{name}}**
{{/each}}
"
| render containerStyle={containerStyle backgroundColor="#f8dd91"}
